    const [API_KEY, API_URL] = props.API_CONSTS;

    async function hitAPIForSearch() {
        // const response = axios.get(`${API_URL}?s=${props.searchTerm}&apikey=${API_KEY}`);
        const response = axios.get(`http://www.omdbapi.com/?s=iron&apikey=1ab924a0`);
        console.log(response);
    }

    useEffect(() => hitAPIForSearch(), []);

    return (<div>
        <Tile />
    </div>);
}

export default ListHolder;
